import React from "react";
import { Link } from "react-router-dom";
import "./styles/Home.css";

class Home extends React.Component {
  render() {
    return (
      <div className="container-fluid home">
        <div className="row content-slider">
          <h1>hola</h1>
          <div className="col-9" />
        </div>
      </div>
    );
  }
}

export default Home;
